import { BrowserRouter, Route, Routes } from 'react-router-dom';

import CadastroClientePage from '../src/pages/CadastroCLientePage';
import ClientesListPage from '../src/pages/ClientListPage';
import EditarCliente from '../src/pages/EditarCliente';
import HomePage from '../src/pages/HomePage';
import './index.css';

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/clientes" element={<ClientesListPage />} />
        <Route path="/cadastro" element={<CadastroClientePage />} />
        <Route path="/editar/:id" element={<EditarCliente />} />
        <Route path="*" element={<HomePage />} />
      </Routes>
    </BrowserRouter>
  );
}
